Saadaolevad käsud:
  @show              ─ kuva viimase adaptiivse kaardi kokkuvõte
  @json              ─ väljasta voost saadud toores JSON-väärtus
  @back              ─ taasta eelmine blokeeritud kaart/sisendid
  @input <k>=<v>     ─ määra või kirjuta üle sisendväli
  @click <action_id> ─ saada kaart määratud tegevusega
  @help              ─ kuva see abitekst
  @quit              ─ välju REPL-ist
